import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import NavbarHeader from "./components/NavbarHeader/NavbarHeader";
// import { createBrowserHistory as history } from "history";
import SideBar from "./components/SideBar/SideBar";
// import SideNav from "./components/SideNav";
import Client from "./components/Client/Client";
import Project from "./components/Project/Project";
import Employees from "./components/Employees";
import Home from "./components/Home";
import ProjectSummary from "./components/Project/ProjectSummary";
import Expense from "./components/Expense/Expense";
import AddExpenseSheet from "./components/Expense/AddExpenseSheet";
import Login from "./components/Login/Login";
import Logout from "./components/Logout/Logout";
import LogoutConfirmation from "./components/Logout/LogoutConfirmation";
import { useSelector } from "react-redux";
// import { GetExpenseSheets } from "./services/expense.service";
// import PrivateRoute from "./PrivateRoute";
import store from "./store";
import { Provider } from "react-redux";

function App() {
  const { isLoggedIn } = useSelector((state) => state.auth);
  useSelector((state) => console.log(state.auth));
  return (
    <>
    <Provider store={store}>
      {/* <NavbarHeader /> */}
      {/* isLoggedIn && <SideBar/> */}
      {/* isLoggedIn && <SideNav /> */}
      <Router>
        {isLoggedIn && <NavbarHeader />}
        {/* {isLoggedIn && <SideBar />} */}
        {/* {isLoggedIn && <GetExpenseSheets />} */}

        <Switch>
          <Route exact path="/login" component={Login} />
          <Route exact path="/" component={Login} />
          <Route exact path="/home" component={Home} />
          <Route path="/expenseSheet" component={Expense} />
          <Route path="/expenseEntries" component={AddExpenseSheet} />
          <Route path="/clients" component={Client} />
          <Route path="/projects" component={Project} />
          <Route exact path="/projectsummary" component={ProjectSummary} />
          <Route path="/projectsummary/:pid" component={ProjectSummary} />
          <Route path="/employees" component={Employees} />
          <Route exact path="/logout" component={Logout} />
          <Route
            exact
            path="/logoutconfirmation"
            component={LogoutConfirmation}
          />
          <Route default component={Login} />
        </Switch>
      </Router>
      </Provider>
    </>
  );
}

export default App;
